const mongoose = require('mongoose'),
      Demo = mongoose.model('Demo');

module.exports = {
    viewPage: (req, res) => {
        Demo.find({}, (err, result) => {
            if (err) {
                res.send(err);
            }
            var processedResult = result.map((item, idx) => {
                item.sales = item.sales.toFixed(2);
                item.seasonalCoefficient = item.seasonalCoefficient.toFixed(2);
                item.salesClearedFromSeasonality = item.salesClearedFromSeasonality.toFixed(2);
                item.trend = item.trend.toFixed(2);
                item.forecast = item.forecast.toFixed(2);
                return item
            })
            res.render('demo', {title: 'Demo', data: processedResult});
        })
        .limit(20)
    },
    fillCollectionWithData: (req, res) => {
        Demo.insertMany(data, (err, result) => {
            if (err) {
                res.send(err);
            }
            res.redirect('/demo');
        })
    }
}

